export default function SignUp(props) {
    return (
        <div>
            <form>
                <input type="email" placeholder="email"></input>
                <input type="text" placeholder="password"></input>
                <button>Sign up</button>
            </form>
            <div>
                <p>Password Re</p>
            </div>
        </div>
    )
}
